import React from 'react';
import { Grid, Typography } from '@mui/material'; // Импорт компонентов из Material-UI
import ButterflyCard from './ButterflyCard'; // Импорт созданного вами компонента

// Мокап данных с информацией о бабочках
const butterfliesData = [
  { id: 1, name: 'Бабочка 1', description: 'Описание бабочки 1' },
  { id: 2, name: 'Бабочка 2', description: 'Описание бабочки 2' },
  // Добавьте дополнительные бабочки по мере необходимости
];

export default function GalleryPage() {
  return (
    <div>
      <Typography variant="h4" gutterBottom>
        Галерея бабочек
      </Typography>
      <Grid container spacing={2}>
        {butterfliesData.map((butterfly) => (
          <Grid item xs={12} sm={6} md={4} key={butterfly.id}>
            <ButterflyCard butterfly={butterfly} />
          </Grid>
        ))}
      </Grid>
    </div>
  );
}
